  true,\n\t\"url\": null,\n\t\"notes\": \"The District Survey of Alternative Schools
  and Programs, 2007-08 (FRSS 96), is a study that is part of the Fast Response Survey
  System (FRSS) program; program data is available since 1998-99 at <http://nces.ed.gov/surveys/frss/downloads.asp>.
  FRSS 96 (http://nces.ed.gov/surveys/frss/) is a sample survey that provides national
  estimates on the availability of alternative schools and programs for students at
  risk of educational failure in public school districts during the 2007-08 school
  year. The study was conducted using mailed paper questionnaires. Superintendents
  were sampled. The study's response rate was 96 percent. Key statistics produced
  from FRSS 96 were that students who attend alternative schools and programs are
  typically at risk of educational failure (as indicated by poor grades, truancy,
  disruptive behavior, pregnancy, or similar factors associated with temporary or
  permanent withdrawal from school).\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
